import React, {Component} from "react";

class Cv extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="cv">
                <div>{ this.props.id+" "+this.props.fileName }</div>
                <div>{ this.props.content}</div>
            </div>
        );
    }
}

export default Cv;
